import React, { useEffect, useState } from 'react';
import { View, TextInput, StyleSheet, Button, Text, ImageBackground, Dimensions, Image } from 'react-native';
import { ActivityIndicator } from 'react-native';
import { createUserWithEmailAndPassword, signInWithEmailAndPassword } from 'firebase/auth';
import { useNavigation } from '@react-navigation/native';
import useAuth from '../hooks/useAuth';
import { FIREBASE_AUTH } from '../firebase';

const staticImage = require('../images/Logo.png');

const LoginScreen = () => {
  const navigation = useNavigation();
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const auth = FIREBASE_AUTH;

  useEffect(() => {
    navigation.setOptions({
      headerShown: false,
    });
  }, [navigation]);

  const signIn = async () => {
    setLoading(true);
    try {
      const response = await signInWithEmailAndPassword(auth, email, password);
      console.log(response);
    } catch (error) {
      console.log(error);
    } finally {
      setLoading(false);
    }
  };

  const signUp = async () => {
    setLoading(true);
    try {
      const response = await createUserWithEmailAndPassword(auth, email, password);
      console.log(response);
      alert('Check your email!');
    } catch (error) {
      console.log(error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <View style={styles.container}>
      <View style={styles.background}>
        <View style={styles.content}>
            <View style={styles.logoContainer}>
                <Image source={staticImage} style={styles.logoImg}/>
            </View>
            <View style={styles.textContainer}>
                <Text style={styles.text}>Login/Sign up to continue</Text>
            </View>
            <View style={styles.inputContainer}>
                <TextInput
                    value={email}
                    style={styles.input}
                    placeholder="Email"
                    autoCapitalize="none"
                    onChangeText={(text) => setEmail(text)}
                    placeholderTextColor="#E39727"
                />
                <TextInput
                    value={password}
                    secureTextEntry={true}
                    style={styles.input}
                    placeholder="Password"
                    autoCapitalize="none"
                    onChangeText={(text) => setPassword(text)}
                    placeholderTextColor="#E39727"
                />
            </View>
            <View style={styles.buttonContainer}>
                {loading ? (
                    <ActivityIndicator size="large" color="#0000ff" />
                    ) : (
                    <>
                        <Button title="Login" onPress={signIn} />
                        <Button title="Create an Account" onPress={signUp} />
                    </>
                )}
            </View>
            <View style={styles.iconsContainer}>
                <TouchableOpacity style={styles.icon}>
                    <AntDesign name="google" size={24} color="#E39727" />
                </TouchableOpacity>
                <TouchableOpacity style={styles.icon}>
                    <AntDesign name="twitter" size={24} color="#E39727" />
                </TouchableOpacity>
                <TouchableOpacity style={styles.icon}>
                    <AntDesign name="facebook-square" size={24} color="#E39727" />
                </TouchableOpacity>
            </View>
        </View>
      </View>
    </View>
  );
};

export default LoginScreen;

const windowWidth = Dimensions.get('window').width;
const windowHeight = Dimensions.get('window').height;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      justifyContent: 'center',
    },
    background: {
      flex: 1,
      resizeMode: 'cover',
    },
    content: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center',
      paddingHorizontal: 32,
    },
    logoContainer: {
      marginBottom: 40,
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
    },
    logoImg: {
        height: 300,
        width: 300,
    },
    textContainer: {
      marginBottom: 40,
      // Your text container styling goes here
    },
    text: {
      fontFamily: 'Rubik',
      fontWeight: '600',
      fontSize: 18,
      color: '#000',
      textAlign: 'center',
    },
    inputContainer: {
      marginBottom: 20,
      // Your input container styling goes here
    },
    buttonContainer: {
      marginBottom: 20,
      // Your button container styling goes here
    },
    iconsContainer: {
      flexDirection: 'row',
      justifyContent: 'space-between',
      marginTop: 'auto',
      marginBottom: 20,
      paddingHorizontal: 32,
    },
    icon: {
      borderWidth: 1,
      borderColor: '#E39727',
      borderRadius: 4,
      padding: 8,
    },
  });

